DROP TABLE IF EXISTS `t_bank_payment_records`;
CREATE TABLE `t_bank_payment_records` (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `pay_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '支付类型  例如： UPI',
  `order_no` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '支付订单号',
  `utr_code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '银行UTR编号',
