  `amount` bigint NOT NULL COMMENT '支付金额,单位分',
  `trade_date` bigint NOT NULL COMMENT '付款时间',
  `created_at` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  `updated_at` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  `is_sync` tinyint(1) unsigned zerofill NOT NULL DEFAULT '0' COMMENT '是否同步1是0否',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `utr_code` (`utr_code`) USING BTREE,
  UNIQUE KEY `order_no` (`order_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=648 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='银行收款记录';

