-- ----------------------------
-- Table structure for t_draw_money
-- ----------------------------
DROP TABLE IF EXISTS `t_draw_money`;
CREATE TABLE `t_draw_money` (
  `draw_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '结汇订单号',
  `mch_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商户号',
  `isv_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '服务商号',
  `app_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '应用ID',
  `mch_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商户名称',
  `currency` varchar(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT 'BRL' COMMENT '货币代码,印度卢比:INR,哥伦比亚比索:COR',
  `now_balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '当前总资产',
  `day_balance` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '当日交易额',
  `draw_amount` decimal(20,2) NOT NULL COMMENT '提取资产',
  `mch_fee_rate` decimal(20,6) NOT NULL COMMENT '提取费率',
  `mch_fee_amount` decimal(20,2) DEFAULT NULL COMMENT '提取手续费',
  `draw_amount_to` decimal(20,2) DEFAULT NULL COMMENT '商户实际扣取',
  `amount` decimal(20,2) DEFAULT NULL COMMENT '汇款金额',
  `exchange_rate` decimal(20,2) DEFAULT NULL COMMENT '汇率',
  `entry_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '入账方式： BANK_CARD-银行卡;TRC20;ERC20',
  `account_no` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '收款账号',
  `draw_desc` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '收款信息',
  `audit_desc` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '备注信息',
  `state` tinyint NOT NULL DEFAULT '0' COMMENT '结汇状态: 0-订单生成, 1-审核未通过, 2-审核已通过, 3-转账成功, 4-转账失败',
  `created_at` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  `updated_at` timestamp(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  PRIMARY KEY (`draw_id`) USING BTREE,
  KEY `created_at` (`created_at`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='结汇信息表';

