-- ----------------------------
-- Table structure for t_transfer_order
-- ----------------------------
DROP TABLE IF EXISTS `t_transfer_order`;
CREATE TABLE `t_transfer_order` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `transfer_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '转账订单号',
  `mch_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商户号',
  `isv_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '服务商号',
  `app_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '应用ID',
  `mch_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商户名称',
  `mch_type` tinyint NOT NULL COMMENT '类型: 1-普通商户, 2-特约商户(服务商模式)',
  `mch_order_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '商户订单号',
  `if_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '支付接口代码',
  `way_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '支付方式代码',
  `entry_type` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '入账方式： WX_CASH-微信零钱; ALIPAY_CASH-支付宝转账; BANK_CARD-银行卡',
  `amount` bigint NOT NULL COMMENT '转账金额,单位分',
  `mch_fee_rate` decimal(20,6) NOT NULL COMMENT '商户手续费费率快照',
  `mch_fee_amount` bigint DEFAULT NULL COMMENT '手续费快照',
  `amount_to` bigint DEFAULT NULL COMMENT '商户实际转出,单位分',
  `currency` varchar(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '三位货币代码,印度:INR,人民币:CNY,墨西哥:MXN,尼日利亚:NGN',
  `account_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '收款账号',
  `account_name` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收款人姓名',
  `account_email` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收款人邮箱	',
  `account_phone` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收款人手机号	',
  `account_code` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收款账号编码',
  `bank_name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收款人开户行名称',
  `transfer_desc` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '转账备注信息',
  `client_ip` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '客户端IP',
  `state` tinyint NOT NULL DEFAULT '0' COMMENT '支付状态: 0-订单生成, 1-转账中, 2-转账成功, 3-转账失败, 4-订单关闭',
  `channel_extra` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '特定渠道发起额外参数',
  `channel_order_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '渠道订单号',
  `err_code` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '渠道支付错误码',
  `err_msg` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '渠道支付错误描述',
  `ext_param` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '商户扩展参数',
  `notify_url` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '' COMMENT '异步通知地址',
  `success_time` datetime DEFAULT NULL COMMENT '转账成功时间',
  `channel_fee` bigint DEFAULT NULL COMMENT '渠道出款手续费，单位分',
  `channel_amount` bigint DEFAULT NULL COMMENT '渠道转账金额(去除手续费，商户实际收到的金)\n额)',
  `channel_amount_to` bigint DEFAULT NULL COMMENT '渠道交易总金额(包含手续费), 单位分',
  `channel_req` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '请求渠道交易',
  `channel_res` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '渠道交易响应',
  `channel_notify` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '渠道通知',
  `channel_query_req` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '查询渠道请求',
  `channel_query_res` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '查询渠道响应',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `Uni_MchNo_MchOrderNo` (`mch_no`,`mch_order_no`) USING BTREE,
  KEY `created_at` (`created_at`) USING BTREE,
  KEY `idx_transfer_order_mch_order_no` (`mch_order_no`) USING BTREE,
  KEY `idx_transfer_order_channel_order_no` (`channel_order_no`) USING BTREE,
  KEY `idx_transfer_order_mch_no_mch_order_no` (`mch_no`,`mch_order_no`) USING BTREE,
  KEY `idx_transfer_order_mch_no_channel_order_no` (`mch_no`,`channel_order_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='转账订单表';

